import React, { Fragment } from "react";
import { useStore } from "../store/store";

const Search = () => {
  const { businessStore } = useStore();

  return (
    <Fragment>
      <h2>Search</h2>
      <label></label>
      {businessStore.business.map((x) => (
        <li key={x.id}>
          {x.name}
        </li>
      ))}
    </Fragment>
  );
};

export default Search;
